import {Card } from "react-bootstrap";

function Jobs({ job }) {
  return (
    <Card className="my-3 p-3 round">
      <a href={"job/${job.Id}"}></a>
      <Card.Body>
        <a href={"job/${job.Id}"}>
          <Card.Title as="div">
            {job.JobTitle}
          </Card.Title>
        </a>
        <Card.Text as='div'>
            <div className = "my-3">

            </div>
        </Card.Text>
      </Card.Body>
    </Card>
  );
}

export default Jobs;
